import React from 'react';
import { Link } from 'react-router-dom';
import telangana from '../Data/telangana.json';

function DetailRecipe() {

    return (
        <div>
         <div className="recipes-list">
         <h1>-{Recipes.id} Categories-</h1>
                {telangana.map(telangana => (
                    <div key={telangana.id} className="cards"  style={{padding:"10px",width:"400px",marginLeft:"25px"}}>
                        <img src={telangana.image} className="card-img" alt={telangana.title} />
                        <div className="card-body">
                            <h5 className="card-title" style={{textAlign:"center"}}>
                                <b>{telangana.title}</b></h5>
                                <p  style={{paddingLeft:"20px"}}>{telangana.description}</p>
                        </div>
                        <Link to={`/detail/{telangana.id}`} className="cardbutton" >Go to Course</Link>
                    </div>
                ))}
            </div>
    </div>
    );
}

export default DetailRecipe;
